import React from 'react';
import './HeaderComponent.scss';

const Header = props => {
    const redirectToHome = () => {
        props.history.push('/');
    }
    return(
        <div className="header-text">  
            <span className="header-rit" onClick={redirectToHome}> RIT | </span>
            <span className="header-roc" onClick={redirectToHome}> Rochester Institute of Technology </span>
        </div>
    );
}

export default Header;
